// https://leetcode-cn.com/problems/max-sum-of-rectangle-no-larger-than-k/
int maxSumSubmatrix(vector<vector<int>>& matrix, int k) {
#if 0
    int rows = static_cast<int>(matrix.size());
    int cols = static_cast<int>(matrix[0].size());
    vector<vector<int>> prefix(rows + 1, vector<int>(cols + 1, 0));

    for (int i = 1; i <= rows; i++) {
        for (int j = 1; j <= cols; j++) {
            prefix[i][j] = prefix[i - 1][j] + prefix[i][j - 1] - prefix[i - 1][j - 1] + matrix[i - 1][j - 1];
        }
    }
    int result = INT_MIN;
    for (int leftRow = 1; leftRow <= rows; leftRow++) {
        for (int leftCol = 1; leftCol <= cols; leftCol++) {
            for (int rightRow = leftRow; rightRow <= rows; rightRow++) {
                for (int rightCol = leftCol; rightCol <= cols; rightCol++) {
                    int tmp = prefix[rightRow][rightCol] - prefix[leftRow - 1][rightCol] - prefix[rightRow][leftCol - 1] + prefix[leftRow - 1][leftCol - 1];
                    if (tmp <= k && tmp > result) {
                        result = tmp;
                    }
                }
            }
        }
    }
    return result;
#endif

#if 1
    int rows = static_cast<int>(matrix.size());
    int cols = static_cast<int>(matrix[0].size());
    vector<vector<int>> prefix(rows + 1, vector<int>(cols + 1, 0));

    for (int i = 1; i <= rows; i++) {
        for (int j = 1; j <= cols; j++) {
            prefix[i][j] = prefix[i - 1][j] + prefix[i][j - 1] - prefix[i - 1][j - 1] + matrix[i - 1][j - 1];
        }
    }
    int result = INT_MIN;
    for (int top = 1; top <= rows; top++) {
        for (int bottom = top; bottom <= rows; bottom++) {
            set<int> cache;
            cache.insert(0);
            for (int end = 1; end <= cols; end++) {
                // sum[j] - sum[i - 1] <= k
                // sum[j] - k <= sum[i]
                int right = prefix[bottom][end] - prefix[top - 1][end];
                auto left = cache.lower_bound(right - k);
                if (left != cache.end()) {
                    int tmp = right - *left;
                    result = max(result, tmp);
                }
                cache.insert(right);
            }
        }
    }
    return result;
#endif
}

